import { useRef, useState } from 'react'
import "./contact.css"
import Phone from '../../Img/phone.png'
import Email from '../../Img/email.png'
import Address from '../../Img/location.png'
import emailjs from '@emailjs/browser';


function Contact() {

    const formRef = useRef()
    const  [done,setDone] = useState(false);

    const handleSubmit = (e) => {
        e.preventDefault();

        emailjs.sendForm('service_yyp9qyo', 'template_oahodrw', formRef.current, 'zqTjEf9wfB3_vMyQX')
            .then((result) => {
                console.log(result.text);
                setDone(true);
                document.getElementById("name").value ="";
                document.getElementById("email").value ="";
                document.getElementById("subject").value ="";
                document.getElementById("msg").value ="";

            }, (error) => {
                console.log(error.text);
            });
    }
    return (
        <div className='c'>
            <div className='c-bg'></div>
            <div className='c-wrapper'>
                <div className='c-left'>
                    <h1 className='c-title'>Interested to work together? Let's talk</h1>
                    <div className='c-info'>
                        <div className='c-info-item'>
                            <img className='c-icon'
                                src={Phone}
                                alt=''
                            />
                            +91 8657828477
                        </div>
                        <div className='c-info-item'>
                            <img className='c-icon'
                                src={Email}
                                alt=''
                            />
                            vedantkale8114@gmail.com
                        </div>
                        <div className='c-info-item'>
                            <img className='c-icon'
                                src={Address}
                                alt=''
                            />
                            C-wing 604 Mahalaxmi CHS, worli, Mumbai-30
                        </div>
                    </div>
                </div>
                <div className='c-right'>
                    <form ref={formRef} onSubmit={handleSubmit}>
                        <input id="name" type="text" placeholder="Name" name="user_name" />
                        <input id="email" type="text" placeholder="Email" name="user_email" />
                        <input id="subject" type="text" placeholder="Subject" name="user_subject" />
                        <textarea id="msg" rows='5' placeholder="Message" name="message" />
                        <button>Submit</button>
                        {done && "  Thank You"}
                    </form>
                </div>
            </div>
            <div className='p'>
            <p >
                Copyright © 2022 VEDANT KALE. All rights reserved
            </p>
            <p>
                Designed by 
                <a rel="nofollow" href="https://www.linkedin.com/in/vedant-kale-1b3b9523b/">Vedant kale</a>
            </p>
            </div>
            
        </div>
    )
}

export default Contact
